import React from 'react';
import ReactDOM from 'react-dom/client';
import axios from "axios";
import 'bootstrap/dist/css/bootstrap.css';
import "./styles.css";

async function getData(endpoint) {
  let response = await axios.get(`https://www.jsonkeeper.com/${endpoint}`);
  return response.data;
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div className="container justify-content-center text-center">
      <img src='app/img/icon.PNG'></img>
      <div className='row'>
        <div className='col-6'>Hours open:<br></br>Mon: 11am - 9pm  Tues: 11am - 9pm<br></br>Wed: 11am - 9pm  Thur: 11am - 9pm<br></br>Fri: 12am - 12pm Sat: 12am - 12pm<br></br>Sun: 10am - 7pm</div>
      </div>
    </div>
  </React.StrictMode>
);
